import React, { useState } from 'react';
import {
    CNavbar,
    CContainer,
    CNavbarBrand,
    CNavbarToggler,
    CCollapse,
    CNavbarNav,
    CNavItem,
    CNavLink,
    CDropdown,
    CDropdownToggle,
    CDropdownMenu,
    CDropdownItem,
    CForm,
    CFormInput,
    CButton
} from '@coreui/react';

const Navbar = () => {
    const [visible, setVisible] = useState(false);

    return (
        <>
            <CNavbar expand="lg" colorScheme="light" className="bg-light">
                {/* Navbar content */}
            </CNavbar>
        </>
    );
};

export default Navbar;
